import React,{useState} from 'react';
const getMobileNumber=(text)=>{
    const [string,setString]= useState('');
  var mobile= string
    string =(text.replace(/([+]?\d{1,2}?)?(\d{3}?){2}\d{5}/g))
    setString(mobile);
    return(
      <div style={{ whiteSpace: 'nowrap' }}>{string}</div>
    )
  }
  export default getMobileNumber;
